import React from 'react';
import { Box, Typography, TextField, Button } from '@mui/material';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import { registerUser } from '../services/authService';
import { useAuth } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';

function RegisterPage() {
  const { login } = useAuth();
  const navigate = useNavigate();

  const formik = useFormik({
    initialValues: {
      name: '',
      studentId: '',
      email: '',
      password: '',
      confirmPassword: '',
      role: 'student', // กำหนด default role เป็น student
    },
    validationSchema: Yup.object({
      name: Yup.string().required('กรุณากรอกชื่อ'),
      studentId: Yup.string().required('กรุณากรอกรหัสนักศึกษา'),
      email: Yup.string().email('รูปแบบอีเมลไม่ถูกต้อง').required('กรุณากรอกอีเมล'),
      password: Yup.string()
        .min(6, 'รหัสผ่านต้องมีอย่างน้อย 6 ตัวอักษร')
        .required('กรุณากรอกรหัสผ่าน'),
      confirmPassword: Yup.string()
        .oneOf([Yup.ref('password'), null], 'รหัสผ่านไม่ตรงกัน')
        .required('กรุณายืนยันรหัสผ่าน'),
    }),
    onSubmit: async (values, { setSubmitting, setErrors }) => {
      try {
        // เรียก API ลงทะเบียน
        const res = await registerUser({
          name: values.name,
          studentId: values.studentId,
          email: values.email,
          password: values.password,
          role: values.role,
        });

        // login อัตโนมัติหลังลงทะเบียนสำเร็จ
        login(res.data);

        // ไปที่หน้า dashboard
        navigate(values.role === 'admin' ? '/admin' : '/student');
      } catch (error) {
        if (error.response && error.response.data.message) {
          setErrors({ submit: error.response.data.message });
        } else {
          setErrors({ submit: 'เกิดข้อผิดพลาด กรุณาลองใหม่' });
        }
      } finally {
        setSubmitting(false);
      }
    },
  });

  return (
    <Box sx={{ maxWidth: 400, mx: 'auto', mt: 10 }}>
      <Typography variant="h4" gutterBottom>
        ลงทะเบียน
      </Typography>

      <form onSubmit={formik.handleSubmit}>
        <TextField
          label="ชื่อ"
          name="name"
          fullWidth
          margin="normal"
          value={formik.values.name}
          onChange={formik.handleChange}
          error={formik.touched.name && Boolean(formik.errors.name)}
          helperText={formik.touched.name && formik.errors.name}
        />

        <TextField
          label="รหัสนักศึกษา"
          name="studentId"
          fullWidth
          margin="normal"
          value={formik.values.studentId}
          onChange={formik.handleChange}
          error={formik.touched.studentId && Boolean(formik.errors.studentId)}
          helperText={formik.touched.studentId && formik.errors.studentId}
        />

        <TextField
          label="อีเมล"
          name="email"
          fullWidth
          margin="normal"
          value={formik.values.email}
          onChange={formik.handleChange}
          error={formik.touched.email && Boolean(formik.errors.email)}
          helperText={formik.touched.email && formik.errors.email}
        />

        <TextField
          label="รหัสผ่าน"
          name="password"
          type="password"
          fullWidth
          margin="normal"
          value={formik.values.password}
          onChange={formik.handleChange}
          error={formik.touched.password && Boolean(formik.errors.password)}
          helperText={formik.touched.password && formik.errors.password}
        />

        <TextField
          label="ยืนยันรหัสผ่าน"
          name="confirmPassword"
          type="password"
          fullWidth
          margin="normal"
          value={formik.values.confirmPassword}
          onChange={formik.handleChange}
          error={formik.touched.confirmPassword && Boolean(formik.errors.confirmPassword)}
          helperText={formik.touched.confirmPassword && formik.errors.confirmPassword}
        />

        {formik.errors.submit && (
          <Typography color="error" sx={{ mt: 1 }}>
            {formik.errors.submit}
          </Typography>
        )}

        <Button type="submit" fullWidth variant="contained" sx={{ mt: 2 }}>
          ลงทะเบียน
        </Button>

        <Button fullWidth onClick={() => navigate('/')} sx={{ mt: 1 }}>
          กลับไปหน้าเข้าสู่ระบบ
        </Button>
      </form>
    </Box>
  );
}

export default RegisterPage;
